import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "./notes";

export default function App() {
  return (
    <>
      <Header />
      <div>
        notes.map((entry) => (
        <Note key={entry.key} title={entry.title} />
        ))
      </div>

      <Footer />
    </>
  );
}
